import React, { Component } from "react";
import ContentContainer from "../../components/contentContainer/ContentContainer";
import s from "./ContactUsPage.module.css";
import Card from "../../ui/Card";
import ContactUsForm from "./contactUsForm/ContactUsForm";
import Button from "../../ui/Button";

export default class ContactUsPage extends Component {
  render() {
    return (
      <ContentContainer>
        <div className={`${s.ContactUsPage} PaddingLeft`}>
          <Card
            header="Contact Us"
            text="Please fill out the form below and we will get back in touch with you."
            extraClass={s.ContactUs}
          />
          <form>
            <fieldset>
              <div className={s.FormElements}>
                <label htmlFor="name">Name</label>
                <span>
                  <input type="text" id="name" name="name" required />
                </span>
                <label htmlFor="email">Email</label>
                <span>
                  <input type="email" id="email" name="email" required />
                </span>
                <label htmlFor="comment">Comment</label>
                <span>
                  <textarea id="comment" cols="5" name="comment"></textarea>
                </span>
                <Button type="submit" text="Submit" />
              </div>
            </fieldset>
          </form>
        </div>
      </ContentContainer>
    );
  }
}
